import { StyleSheet } from "react-native"

const style = StyleSheet.create ({
    viewHeader: {
        width: '100%',
        height: '20%',
        backgroundColor: '#212529',
        flexDirection: 'row',
        justifyContent: 'center',
        alignItems: 'center',
    },

    text: {
        color: '#fff',
        marginLeft: 20,
        fontSize: 30
    },

    logo: {
        width: 50,
        height: 50
    },
})

export default style;
